import React, { Component } from "react";
import { MDBBtn, MDBCard, MDBCardBody, MDBCardImage, MDBCardTitle, MDBCardText, MDBCol } from 'mdbreact';


class Card extends Component {
    render(){
        return ( 
            <MDBCol>
                <MDBCard className = "homecard">

                    <MDBCardBody >
                        <MDBCardTitle > 
                            {this.props.title} 
                        </MDBCardTitle> 
                        <MDBCardText >
                            {this.props.desc}
                        </MDBCardText> 
                        <MDBBtn href = "#" > 
                            Pay ${this.props.cost} 
                        </MDBBtn> 
                    </MDBCardBody> 
                </MDBCard> 
            </MDBCol>
        );
    }

}

export default Card;
